script: |
  super -f text -I q9533.spq | sort > q9533.out

inputs:
  - name: q9533.spq
    data: |
      SELECT - 98 + + ( col0 ) AS col1, + col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( col2 * - col2 / + col0 * col1 ) NOT IN ( col1 );
  - name: tab1

outputs:
  - name: q9533.out
    data: |
      -13	59
      -47	96
      -7	68
